import React, { useState } from "react";
import axios from "axios";
import "../styles/AdminEvent.css"; // Assure-toi que ce fichier est correctement lié
import eventIcon from "../assets/events.png"; // Icône pour la section des événements
import certificateIcon from "../assets/certificate.png"; // Icône pour la section des certificats
import logoutIcon from "../assets/logout.png"; // Icône de déconnexion
import profilePic from "../assets/user.png"; // Photo de profil
import logoIcon from "../assets/logo.png"; // Icône de logo

const ORGaddparticipants = () => {
  const [participantEmail, setParticipantEmail] = useState(""); // Gérer l'email du participant
  const [message, setMessage] = useState(""); // Message de succès ou d'erreur
  const [isLoading, setIsLoading] = useState(false); // Gérer l'état de chargement

  const handleAddParticipant = async (eventId) => {
    // Fonction pour ajouter un participant à un événement
    const token = localStorage.getItem("token"); // Récupérer le token depuis le localStorage
    if (token) {
      try {
        setIsLoading(true); // Démarrer le chargement
        const response = await axios.post(
          `https://ton-api.com/events/${eventId}/participants`,
          { email: participantEmail },
          {
            headers: { Authorization: `Bearer ${token}` }, // Ajouter le token dans les en-têtes
          }
        );
        setMessage("Participant added successfully!"); // Message de succès
      } catch (error) {
        setMessage("Error adding participant. Please try again."); // Message d'erreur
        console.error("Erreur lors de l'ajout du participant:", error);
      } finally {
        setIsLoading(false); // Arrêter le chargement
      }
    } else {
      setMessage("No token found. Please log in again."); // Message si le token est absent
    }
  };

  return (
    <div className="admin-container">
      {/* Sidebar */}
      <aside className="sidebar">
        <div className="logo-container">
          <img src={logoIcon} alt="logo" className="logo-icon" />
          <span className="logo-text">MYCERTS</span>
        </div>
        <nav>
          <ul>
            <li>
              <img src={eventIcon} alt="Events" />
              <span>Events</span>
            </li>
            <li>
              <img src={certificateIcon} alt="Certificates" />
              <span>MY Certificates</span>
            </li>
          </ul>
        </nav>
        <button className="logout-btn">
          <img src={logoutIcon} alt="Log Out" />
          <span>Log Out</span>
        </button>
      </aside>

      {/* Main Content */}
      <main className="content">
        {/* Header */}
        <div className="header">
          <h2>📅 <span>Add Participant</span></h2>
          <div className="profile">
            <span>S. Ahmed</span>
            <img src={profilePic} alt="Admin Profile" />
          </div>
        </div>

        {/* Add Participant Form */}
        <section className="add-participant-form">
          <input
            type="email"
            placeholder="Enter participant's email"
            value={participantEmail}
            onChange={(e) => setParticipantEmail(e.target.value)}
          />
          <button
            className="add-participant-btn"
            onClick={() => handleAddParticipant(1)} // Remplace '1' par l'ID de l'événement
            disabled={isLoading || !participantEmail}
          >
            {isLoading ? "Adding..." : "Add Participant"}
          </button>
        </section>

        {/* Message */}
        {message && <p className="message">{message}</p>}
      </main>
    </div>
  );
};

export default ORGaddparticipants;
